import React, { useState } from "react";
import "./OrarToti.css";

const OrarToti = () => {
  const [activeCategory, setActiveCategory] = useState(null); // Categoria activă
  const [activeYear, setActiveYear] = useState(null); // Anul sau masterul selectat
  const [selectedGroup, setSelectedGroup] = useState(null); // Grupa selectată

  const studentYears = [
    {
      label: "Anul 1",
      groups: ["A1", "A2", "A3", "A4", "A5", "B1", "B2", "B3", "B4", "B5", "E1", "E2", "E3"],
    },
    {
      label: "Anul 2",
      groups: ["A1", "A2", "A3", "A4", "A5", "B1", "B2", "B3", "B4", "B5", "E1", "E2", "E3"],
    },
    {
      label: "Anul 3",
      groups: ["A1", "A2", "A3", "A4", "A5", "B1", "B2", "B3", "B4", "B5", "E1", "E2", "E3"],
    },
    {
      label: "Master Anul 1",
      groups: [
        "Inteligența Artificială și Optimizare",
        "Ingineria Sistemelor Soft",
        "Lingvistica Computațională",
        "Studii Avansate în Informatică",
        "Sisteme Distribuite",
        "Securitatea Informațiilor",
      ],
    },
    {
      label: "Master Anul 2",
      groups: [
        "Inteligența Artificială și Optimizare",
        "Ingineria Sistemelor Soft",
        "Lingvistica Computațională",
        "Studii Avansate în Informatică",
        "Sisteme Distribuite",
        "Securitatea Informațiilor",
      ],
    },
  ];

  return (
    <div className="orar-container">
      <div className="orar-titlu">
        <h1>Orar</h1>
        <h2>Alege o categorie pentru a vizualiza detalii</h2>
      </div>

      {/* Butoane principale */}
      <div className="orar-categories">
        {["Orar Studenți", "Orar Profesori", "Orar Discipline", "Orar Săli"].map((category) => (
          <button
            key={category}
            className={`category-button ${activeCategory === category ? "active" : ""}`}
            onClick={() => {
              setActiveCategory(category);
              setActiveYear(null); // Resetăm anul selectat
              setSelectedGroup(null); // Resetăm grupa selectată
            }}
          >
            {category}
          </button>
        ))}
      </div>

      {/* Conținut pentru "Orar Studenți" */}
      {activeCategory === "Orar Studenți" && (
        <div className="orar-popup">
          {!activeYear ? (
            // Afișăm anii și masterele
            <div className="orar-buttons">
              {studentYears.map((year, index) => (
                <button
                  key={index}
                  className="orar-button"
                  onClick={() => setActiveYear(year)}
                >
                  {year.label}
                </button>
              ))}
            </div>
          ) : (
            // Afișăm grupele pentru anul selectat
            <div className="orar-popup-content">
              <h3>{activeYear.label}</h3>
              {activeYear.groups.map((group, index) => (
                <button
                  key={index}
                  className="dropdown-item"
                  onClick={() => setSelectedGroup(group)}
                >
                  {group}
                </button>
              ))}
              <button
                className="back-button"
                onClick={() => setActiveYear(null)} // Buton pentru a reveni la lista de ani
              >
                Înapoi
              </button>
            </div>
          )}
        </div>
      )}

      {/* Alte categorii */}
      {activeCategory === "Orar Profesori" && (
        <div className="orar-placeholder">
          <h3>Orar Profesori</h3>
          <p>Funcționalitatea pentru orarul profesorilor va fi adăugată aici.</p>
        </div>
      )}
      {activeCategory === "Orar Discipline" && (
        <div className="orar-placeholder">
          <h3>Orar Discipline</h3>
          <p>Funcționalitatea pentru orarul pe discipline va fi adăugată aici.</p>
        </div>
      )}
      {activeCategory === "Orar Săli" && (
        <div className="orar-placeholder">
          <h3>Orar Săli</h3>
          <p>Funcționalitatea pentru orarul sălilor va fi adăugată aici.</p>
        </div>
      )}

      {/* Afișăm tabelul pentru grupa selectată */}
      {selectedGroup && (
        <div className="orar-afisat">
          <h3>Orar pentru {selectedGroup}</h3>
          <p>Aici va fi afișat tabelul pentru grupa selectată.</p>
        </div>
      )}
    </div>
  );
};

export default OrarToti;
